NjI4MjYz', 'url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/labels/Azure.Core', 'name': 'Azure.Core', 'color': 'e99695', 'default': False, 'description': ''}], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': {'url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/milestones/98', 'html_url': 'https://github.com/Azure/azure-sdk-for-java/milestone/98', 'labels_url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/milestones/98/labels', 'id': 7487711, 'node_id': 'MI_kwDOACyxNM4AckDf', 'number': 98, 'title': '[2022] May', 'description': '[2022] May', 'creator': {'login': 'AlexGhiondea', 'id': 8396979, 'node_id': 'MDQ6VXNlcjgzOTY5Nzk=', 'avatar_url': 'https://avatars.githubusercontent.com/u/8396979?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/AlexGhiondea', 'html_url': 'https://github.com/AlexGhiondea', 'followers_url': 'https://api.github.com/users/AlexGhiondea/followers', 'following_url': 'https://api.github.com/users/AlexGhiondea/following{/other_user}', 'gists_url': 'https://api.github.com/users/AlexGhiondea/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/AlexGhiondea/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/AlexGhiondea/subscriptions', 'organizations_url': 'https://api.github.com/users/AlexGhiondea/orgs', 'repos_url': 'https://api.github.com/users/AlexGhiondea/repos', 'events_url': 'https://api.github.com/users/AlexGhiondea/events{/privacy}', 'received_events_url': 'https://api.github.com/users/AlexGhiondea/received_events', 'type': 'User', 'site_admin': False}, 'open_issues': 61, 'closed_issues': 12, 'state': 'open', 'created_at': '2021-12-14T18:52:53Z', 'updated_at': '2022-04-19T17:51:00Z', 'due_on': '2022-05-06T07:00:00Z', 'closed_at': None}, 'comments': 2, 'created_at': '2021-05-20T21:55:16Z', 'updated_at': '2022-04-20T16:12:17Z', 'closed_at': None, 'author_association': 'MEMBER', 'active_lock_reason': None, 'body': "Exceptions like OutOfMemoryError are handled differently by the default Reactor schedulers. Instead of terminating the Flux, the Flux will hang and the exception is only sent to the thread's `uncaughtExceptionHandler` and the Reactor `Schedulers.onHandleError`.

reactor/reactor-core#2521

https://github.com/reactor/reactor-core/blob/84e921fbfd84754d519b5e3c78262495dcf48b87/reactor-core/src/main/java/reactor/core/Exceptions.java#L443

