//api.github.com/users/kushagraThapar/events{/privacy}', 'received_events_url': 'https://api.github.com/users/kushagraThapar/received_events', 'type': 'User', 'site_admin': False}, 'assignees': [{'login': 'kushagraThapar', 'id': 14034156, 'node_id': 'MDQ6VXNlcjE0MDM0MTU2', 'avatar_url': 'https://avatars.githubusercontent.com/u/14034156?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/kushagraThapar', 'html_url': 'https://github.com/kushagraThapar', 'followers_url': 'https://api.github.com/users/kushagraThapar/followers', 'following_url': 'https://api.github.com/users/kushagraThapar/following{/other_user}', 'gists_url': 'https://api.github.com/users/kushagraThapar/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/kushagraThapar/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/kushagraThapar/subscriptions', 'organizations_url': 'https://api.github.com/users/kushagraThapar/orgs', 'repos_url': 'https://api.github.com/users/kushagraThapar/repos', 'events_url': 'https://api.github.com/users/kushagraThapar/events{/privacy}', 'received_events_url': 'https://api.github.com/users/kushagraThapar/received_events', 'type': 'User', 'site_admin': False}], 'milestone': None, 'comments': 20, 'created_at': '2021-02-10T19:40:44Z', 'updated_at': '2022-04-19T18:56:33Z', 'closed_at': '2021-09-15T17:56:19Z', 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'I am working with:
* Java 11
* Spring Boot version 2.3.3
* Azure Spring Data Cosmos version 3.3.0 
* ReactiveCosmosRepository

**Situation**

I understand there is support for pagination in **Sync** Spring Data Cosmos DB as per this [sample](https://github.com/Azure/azure-sdk-for-java/blob/master/sdk/cosmos/azure-spring-data-cosmos/src/samples/java/com/azure/spring/data/cosmos/PageableRepositoryCodeSnippet.java) and this [tutorial](https://docs.microsoft.com/en-us/azure/developer/java/spring-framework/how-to-guides-spring-data-cosmosdb#pagination-and-sorting).

I also understand there is support for pagination using a continuation token in the plain Java Async SDK as per this [page](https://docs.microsoft.com/en-us/azure/developer/java/sdk/pagination#asynchronously-observe-pages-and-individual-elements). Using this, however, requires using two different clients in a spring application: one for async paginated calls and another for the rest.

**Problem**

However, support is restricted to a non-reactive spring repository and to the plain java SDK, as the underlying repository being used in the former is the standard Spring PagingAndSortingRepository:

```
import com.azure.spring.data.cosmos.core.query.CosmosPageRequest;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.data.domain.Page;
import org.springframework.data.domain.Pageable;
import org.springframework.data.repository.PagingAndSortingRepository;

import java.util.List;

public class PageableRepositoryCodeSnippet<T> {

    @Autowired
    private PagingAndSortingRepository<T, String> repository;

    private List<T> findAllWithPageSize(int pageSize) {

        final CosmosPageRequest pageRequest = new CosmosPageRequest(0, pageSize, null);
        Page<T> page = repository.findAll(pageRequest); // <-- this would be a blocking call
        List<T> pageContent = page.getContent();
        while (page.hasNext()) {
            Pageable nextPageable = page.nextPageable();
            page = repository.findAll(nextPageable);
            pageContent = page.getContent();
        }
        return pageContent;
    }
}
```

So, no clear support exists for ReactiveCosmosRepository.

**Similar Solution in Spring Data**

As per this stackoverflow accepted [response](https://stackoverflow.com/questions/45924505/is-there-any-way-to-implement-pagination-in-spring-webflux-and-spring-data-react):

> The reactive support in Spring Data does not provide means of a Page return type. Still, the Pageable parameter is supported in method signatures passing on limit and offset to the drivers and therefore the store itself, returning a Flux<T> that emits the range requested.
> 
> ```
> Flux<Person> findByFirstname(String firstname, Pageable pageable);
> ```

As per this [tutorial](https://thepracticaldeveloper.com/full-reactive-stack-2-backend-webflux/), we could have something like this in the repository:

```
package com.thepracticaldeveloper.reactiveweb.repository;

import com.thepracticaldeveloper.reactiveweb.domain.Quote;

import org.springframework.data.domain.Pageable;
import org.springframework.data.repository.reactive.ReactiveSortingRepository;

import reactor.core.publisher.Flux;

public interface QuoteMongoReactiveRepository extends ReactiveSortingRepository<Quote, String> {

    Flux<Quote> findAllByIdNotNullOrderByIdAsc(final Pageable page);
}
```

And then something like this in the controller:

```
package com.thepracticaldeveloper.reactiveweb.controller;

import com.thepracticaldeveloper.reactiveweb.domain.Quote;
import com.thepracticaldeveloper.reactiveweb.repository.QuoteMongoReactiveRepository;
import org.springframework.data.domain.PageRequest;
import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.RequestParam;
import org.springframework.web.bind.annotation.RestController;
import reactor.core.publisher.Flux;

import java.time.Duration;

@RestController
public class QuoteReactiveController {

    private static final int DELAY_PER_ITEM_MS = 100;

    private final QuoteMongoReactiveRepository quoteMongoReactiveRepository;

    public QuoteReactiveController(final QuoteMongoReactiveRepository quoteMongoReactiveRepository) {
        this.quoteMongoReactiveRepository = quoteMongoReactiveRepository;
    }

    ...

    @GetMapping("/quotes-reactive-paged")
    public Flux<Quote> getQuoteFlux(final @RequestParam(name = "page") int page,
                                    final @RequestParam(name = "size") int size) {
        return quoteMongoReactiveRepository.findAllByIdNotNullOrderByIdAsc(PageRequest.of(page, size))
                .delayElements(Duration.ofMillis(DELAY_PER_ITEM_MS));
    }

}
```

As stated, the suggestion is to replicate a similar API in ReactiveCosmosRepository providing support for Pageable as with WebFlux ReactiveSortingRepository. 

**Important**: given the potential performance limitations of offset limit as opposed to using a continuation token, perhaps a better alternative would be to adjust the logic of the already mentioned spring data cosmos **sync** solution to a reactive repository using Flux or PagedFlux instead.

**EDIT1**: The more I think about it, it seems the best would be to bring PagedFlux and byPage from the Async Java SDK into ReactiveCosmosRepository, that is, bringing the concept from [here](https://docs.microsoft.com/en-us/azure/developer/java/sdk/pagination#observe-pages) into ReactiveCosmosRepository.

> Observe pages
> 
> The following example shows how the PagedFlux API lets you observe each page asynchronously, again by using a byPage() API and by providing a consumer, error consumer, and a completion consumer.
> 
> ```
> asyncClient.listSecrets().byPage()
>   .subscribe(page -> {
>           System.out.println("Response code: " + page.getStatusCode());
>           System.out.println("Continuation Token: " + page.getContinuationToken());
>           page.getElements().forEach(secret -> System.out.println("Secret value: " + secret))
>       },
>       ex -> System.out.println("Error listing pages with secret: " + ex.getMessage()),
>       () -> System.out.println("Successfully listed all pages with secret"));
> ```

Perhaps allowing a findAll method that returns a PagedFlux instead of a Flux:

```
@NoRepositoryBean
public interface ReactiveCosmosDerivedRepository<T, K> extends ReactiveCosmosRepository<T, K> {

    PagedFlux<T> findAllByIsDeleted(boolean b);

}
```

This would be a very clean and elegant API for paged requests in ReactiveCosmosRepository.

**Alternative**
If there is a different and recommended way to support sorting and pagination with ReactiveCosmosRepository, may I suggest adding it to the documentation just as the example provided for non-reactive repositories.

