Problems -> 

* Current version of `CosmosDiagnostics` contains reference to `storeResponseStatistics` which contains reference to `StoreResponse` which contains `CosmosDiagnostics` hence creating a circular dependency in `CosmosDiagnostics`
* Current version of `CosmosDiagnostics` contains reference to `StoreResponse` - with full byte[] content, never freeing up those byte[] content even after the response has been received from the service.
* This increases memory consumption in case of retries from SDK, since the request is maintained throughout retries, containing all the `storeResponse` with full byte[] of contents. 
* Current version of `CosmosDiagnostics` contains reference to `GlobalEndpointManager` which contains reference to some caches, schedulers, ExecutorService, and various other things, which makes it difficult for JVM to collect garbage diagnostics or responses. 
* Current version of `CosmosException` refers to `CosmosDiagnostics`, which refers to `DiagnosticsClientContext` which is actually a reference to `RxDocumentClientImpl` - which exposes all information include caches, Store Models, and what not. 

Solution -> 
* Removed `CosmosDiagnostics` from `StoreResponse` as it is not required there. 
* For `CosmosResponse` types, moved `CosmosDiagnostics` to `RxDocumentServiceResponse` initializing during creation of response. 
* Created serializable versions of `StoreResponse`, `StoreResult`, and `CosmosException`, and performing a deep copy with only instance members required for diagnostics. 
* Removed `GlobalEndpointManager` reference from `CosmosDiagnostics` and just passed it around for capturing `regionsContacted`
* Only exposed `DiagnosticsClientConfig` in `CosmosDiagnostics` - which is only for configs serialization. ', 'created_at': '2022-04-15T19:54:42Z', 'updated_at': '2022-04-19T07:42:40Z', 'closed_at': None, 'merged_at': None, 'merge_commit_sha': 'ef203a165dc3cc04316c1dc137f1c303c363bafb', 'assignee': None, 'assignees': [], 'requested_reviewers': [{'login': 'mbhaskar', 'id': 1904736, 'node_id': 'MDQ6VXNlcjE5MDQ3MzY=', 'avatar_url': 'https://avatars.githubusercontent.com/u/1904736?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/mbhaskar', 'html_url': 'https://github.com/mbhaskar', 'followers_url': 'https://api.github.com/users/mbhaskar/followers', 'following_url': 'https://api.github.com/users/mbhaskar/following{/other_user}', 'gists_url': 'https://api.github.com/users/mbhaskar/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/mbhaskar/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/mbhaskar/subscriptions', 'organizations_url': 'https://api.github.com/users/mbhaskar/orgs', 'repos_url': 'https://api.github.com/users/mbhaskar/repos', 'events_url': 'https://api.github.com/users/mbhaskar/events{/privacy}', 'received_events_url': 'https://api.github.com/users/mbhaskar/received_events', 'type': 'User', 'site_admin': False}, {'login': 'kirankumarkolli', 'id': 6880899, 'node_id': 'MDQ6VXNlcjY4ODA4OTk=', 'avatar_url': 'https://avatars.githubusercontent.com/u/6880899?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/kirankumarkolli', 'html_url': 'https://github.com/kirankumarkolli', 'followers_url': 'https://api.github.com/users/kirankumarkolli/followers', 'following_url': 'https://api.github.com/users/kirankumarkolli/following{/other_user}', 'gists_url': 'https://api.github.com/users/kirankumarkolli/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/kirankumarkolli/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/kirankumarkolli/subscriptions', 'organizations_url': 'https://