ava/pull/28343#discussion_r852663463'}, 'pull_request': {'href': 'https://api.github.com/repos/Azure/azure-sdk-for-java/pulls/28343'}}, 'reactions': {'url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/pulls/comments/852663463/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'start_line': None, 'original_start_line': None, 'start_side': None, 'line': 282, 'original_line': 282, 'side': 'RIGHT', 'in_reply_to_id': 852529434}, 'pull_request': {'url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/pulls/28343', 'id': 911073422, 'node_id': 'PR_kwDOACyxNM42TeCO', 'html_url': 'https://github.com/Azure/azure-sdk-for-java/pull/28343', 'diff_url': 'https://github.com/Azure/azure-sdk-for-java/pull/28343.diff', 'patch_url': 'https://github.com/Azure/azure-sdk-for-java/pull/28343.patch', 'issue_url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/issues/28343', 'number': 28343, 'state': 'open', 'locked': False, 'title': 'Azure cosmos diagnostics memory leak fix', 'user': {'login': 'kushagraThapar', 'id': 14034156, 'node_id': 'MDQ6VXNlcjE0MDM0MTU2', 'avatar_url': 'https://avatars.githubusercontent.com/u/14034156?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/kushagraThapar', 'html_url': 'https://github.com/kushagraThapar', 'followers_url': 'https://api.github.com/users/kushagraThapar/followers', 'following_url': 'https://api.github.com/users/kushagraThapar/following{/other_user}', 'gists_url': 'https://api.github.com/users/kushagraThapar/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/kushagraThapar/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/kushagraThapar/subscriptions', 'organizations_url': 'https://api.github.com/users/kushagraThapar/orgs', 'repos_url': 'https://api.github.com/users/kushagraThapar/repos', 'events_url': 'https://api.github.com/users/kushagraThapar/events{/privacy}', 'received_events_url': 'https://api.github.com/users/kushagraThapar/received_events', 'type': 'User', 'site_admin': False}, 'body': 'Problems -> 

* Current version of `CosmosDiagnostics` contains reference to `storeResponseStatistics` which contains reference to `StoreResponse` which contains `CosmosDiagnostics` hence creating a circular dependency in `CosmosDiagnostics`
* Current version of `CosmosDiagnostics` contains reference to `StoreResponse` - with full byte[] content, never freeing up those byte[] content even after the response has been received from the service.
* This increases memory consumption in case of retries from SDK, since the request is maintained throughout retries, containing all the `storeResponse` with full byte[] of contents. 
* Current version of `CosmosDiagnostics` contains reference to `GlobalEndpointManager` which contains reference to some caches, schedulers, ExecutorService, and various other things, which makes it difficult for JVM to collect garbage diagnostics or responses. 
* Current version of `CosmosException` refers to `CosmosDiagnostics`, which refers to `DiagnosticsClientContext` which is actually a reference to `RxDocumentClientImpl` - which exposes all information include caches, Store Models, and what not. 

Solution -> 
* Removed `CosmosDiagnostics` from `StoreResponse` as it is not required there. 
* For `CosmosResponse` types, moved `CosmosDiagnostics` to `RxDocumentServiceResponse` initializing during creation of response. 
* Created serializable versions of `StoreResponse`, `StoreResult`, and `CosmosException`, and performing a deep copy with only instance members required for diagnostics. 
* Removed `GlobalEndpointManager` reference from `CosmosDiagnostics` and just passed it around for capturing `regionsContacted`
* Only exposed `DiagnosticsClientConfig` in `CosmosDiagnostics` - which is only for configs serialization. ', 'created_at': '2022-04-15T19:54:42Z', 'updated_at': '2022-04-19T07:04:06Z', 'closed_at': None, 'merged_at': None, 'merge_commit_sha': 'ef284f07f69b51e094b1bdab3f30db81c9877904', 'assignee': None, 'assignees': [], 'requested_reviewers': [{'login': 'mbhaskar', 'id': 1904736, 'node_id': 'MDQ6VXNlcjE5MDQ3MzY=', 'avatar_url': 'https://avatars.githubusercontent.com/u/1904736?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/mbhaskar', 'html_url': 'https://github.com/mbhaskar', 'followers_url': 'https://api.github.com/users/mbhaskar/followers', 'following_url': 'https://api.github.com/users/mbhaskar/following{/other_user}', 'gists_url': 'https://api.github.com/users/mbhaskar/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/mbhaskar/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/mbhaskar/subscriptions', 'organizations_url': 'https://api.github.com/users/mbhaskar/orgs', 'repos_url': 'https://api.github.com/users/mbhaskar/repos', 'events_url': 'https://api.github.com/users/mbhaskar/events{/privacy}', 'received_events_url': 'https://api.github.com/users/mbhaskar/received_events', 'type': 'User', 'site_admin': False}, {'login': 'kirankumarkolli', 'id': 6880899, 'node_id': 'MDQ6VXNlcjY4ODA4OTk=', 'avatar_url': 'https://avatars.githubusercontent.com/u/6880899?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/kirankumarkolli', 'html_url': 'https://github.com/kirankumarkolli', 'followers_url': 'https://api.github.com/users/kirankumarkolli/followers', 'following_url': 'https://api.github.com/users/kirankumarkolli/following{/other_user}', 'gists_url': 'https://api.github.com/users/kirankumarkolli/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/kirankumarkolli/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/kirankumarkolli/subscriptions', 'organizations_url': 'https://