Open to making those changes in our work on re-modeling `CosmosDiagnostics` altogether. ", 'created_at': '2022-04-16T17:27:23Z', 'updated_at': '2022-04-16T17:27:23Z', 'html_url': 'https://github.com/Azure/azure-sdk-for-java/pull/28343#discussion_r851652560', 'pull_request_url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/pulls/28343', 'author_association': 'MEMBER', '_links': {'self': {'href': 'https://api.github.com/repos/Azure/azure-sdk-for-java/pulls/comments/851652560'}, 'html': {'href': 'https://github.com/Azure/azure-sdk-for-java/pull/28343#discussion_r851652560'}, 'pull_request': {'href': 'https://api.github.com/repos/Azure/azure-sdk-for-java/pulls/28343'}}, 'reactions': {'url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/pulls/comments/851652560/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'start_line': None, 'original_start_line': None, 'start_side': None, 'line': 102, 'original_line': 102, 'side': 'RIGHT', 'in_reply_to_id': 851554745}, 'pull_request': {'url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/pulls/28343', 'id': 911073422, 'node_id': 'PR_kwDOACyxNM42TeCO', 'html_url': 'https://github.com/Azure/azure-sdk-for-java/pull/28343', 'diff_url': 'https://github.com/Azure/azure-sdk-for-java/pull/28343.diff', 'patch_url': 'https://github.com/Azure/azure-sdk-for-java/pull/28343.patch', 'issue_url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/issues/28343', 'number': 28343, 'state': 'open', 'locked': False, 'title': 'Azure cosmos diagnostics memory leak fix', 'user': {'login': 'kushagraThapar', 'id': 14034156, 'node_id': 'MDQ6VXNlcjE0MDM0MTU2', 'avatar_url': 'https://avatars.githubusercontent.com/u/14034156?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/kushagraThapar', 'html_url': 'https://github.com/kushagraThapar', 'followers_url': 'https://api.github.com/users/kushagraThapar/followers', 'following_url': 'https://api.github.com/users/kushagraThapar/following{/other_user}', 'gists_url': 'https://api.github.com/users/kushagraThapar/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/kushagraThapar/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/kushagraThapar/subscriptions', 'organizations_url': 'https://api.github.com/users/kushagraThapar/orgs', 'repos_url': 'https://api.github.com/users/kushagraThapar/repos', 'events_url': 'https://api.github.com/users/kushagraThapar/events{/privacy}', 'received_events_url': 'https://api.github.com/users/kushagraThapar/received_events', 'type': 'User', 'site_admin': False}, 'body': 'Problems -> 

* Current version of `CosmosDiagnostics` contains reference to `storeResponseStatistics` which contains reference to `StoreResponse` which contains `CosmosDiagnostics` hence creating a circular dependency in `CosmosDiagnostics`
* Current version of `CosmosDiagnostics` contains reference to `StoreResponse` - with full byte[] content, never freeing up those byte[] content even after the response has been received from the service.
* This increases memory consumption in case of retries from SDK, since the request is maintained throughout retries, containing all the `storeResponse` with full byte[] of contents. 
* Current version of `CosmosDiagnostics` contains reference to `GlobalEndpointManager` which contains reference to some caches, schedulers, ExecutorService, and various other things, which makes it difficult for JVM to collect garbage diagnostics or responses. 

Solution -> 
* Removed `CosmosDiagnostics` from `StoreResponse` as it is not required there. 
* For `CosmosResponse` types, moved `CosmosDiagnostics` to `RxDocumentServiceResponse` initializing during creation of response. 
* Created serializable versions of `StoreResponse`, `StoreResult`, and `CosmosException`, and performing a deep copy with only instance members required for diagnostics. 
