/pull/18544.patch', 'issue_url': 'https://api.github.com/repos/Azure/azure-sdk-for-js/issues/18544', 'number': 18544, 'state': 'open', 'locked': False, 'title': 'ParallelQueryExecutionContextBase breaks use of abortSignal', 'user': {'login': 'jay-most', 'id': 71847735, 'node_id': 'MDQ6VXNlcjcxODQ3NzM1', 'avatar_url': 'https://avatars.githubusercontent.com/u/71847735?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/jay-most', 'html_url': 'https://github.com/jay-most', 'followers_url': 'https://api.github.com/users/jay-most/followers', 'following_url': 'https://api.github.com/users/jay-most/following{/other_user}', 'gists_url': 'https://api.github.com/users/jay-most/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/jay-most/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/jay-most/subscriptions', 'organizations_url': 'https://api.github.com/users/jay-most/orgs', 'repos_url': 'https://api.github.com/users/jay-most/repos', 'events_url': 'https://api.github.com/users/jay-most/events{/privacy}', 'received_events_url': 'https://api.github.com/users/jay-most/received_events', 'type': 'User', 'site_admin': False}, 'body': '@azure/cosmos:
3.14.1:
Describe the bug
If an abortSignal object is passed within the FeedOptions object of a query AND
a query rewrite response is initially received by the SDK, an exception is thrown:

userSignal.addEventListener is not a function
The issue is within the function ParallelQueryExecutionContextBase._createTargetPartitionQueryExecutionContext which is attempting to make a deep copy of the query options using JSON.parse(JSON.stringify(...)). This will copy object data but will not copy the abortSignal object member functions which are required to add event listeners for abort triggers.

I recommend the following change for line 474 of azure-sdk-for-js/sdk/cosmosdb/cosmos/src/queryExecutionContext/parallelQueryExecutionContextBase.ts

-        const options = JSON.parse(JSON.stringify(this.options));
+        const options = Object.assign(Object.create(Object.getPrototypeOf(this.options)), this.options);
To Reproduce
Steps to reproduce the behavior:

Query a container for items options.abortSignal defined and a SqlQuerySpec that will trigger a query rewrite.
const abortController = new AbortController();
const querySpec: SqlQuerySpec = {
  query: "SELECT MAX(c._ts) as _ts, c.someAttrib FROM c WHERE IS_DEFINED(c.someAttrib) GROUP BY c.someAttrib",
  parameters: [
  ]
};
const options: FeedOptions = {
  abortSignal: abortController.signal
};
const iterator = container.items.query<T>(querySpec, options);
Expected behavior
